This is a 4 part presentation in 2001, regarding yet another aspect of the Meier Case, it deals specifically with the true Jesus original name was Jmmanuel pronounced Emmanuel. 

a short discription of each part: 

1. A quick introduction to the case in general, by Windelle Stevens. 
2. A talk about a personal investigation regarding the Jesus lost 
years, by Edward T Martin. 
3. A quick comparison between the Talmud of Jmmanuel and the Gospel of Mathew, by Prof. James Deardorf. 
4. A discriton of the teachings in the book Talmud of Jmmanuel 

